const SeekerDelete = () => {
    return (
        <div className="delete-account">
            <h2>Delete account</h2>
            <p>Are you sure ?</p>
            <button>Yes</button>
            <button>No</button>
        </div>
    );
}
 
export default SeekerDelete;
